import React from 'react';
import Custom from '@mevron/cross-core/assets/svg-icon/color-svg/custom-14.svg';

export default function NewFeatureInfo() {
    return (
        <div className="box bg-primary-light pull-up">
            <div className="box-body p-xl-0">
                <div className="row align-items-center">
                    <div className="col-12 col-lg-3">
                        <img src={Custom} alt="" />
                    </div>
                    <div className="col-12 col-lg-9">
                        <h2>Charge Sheet Generator</h2>
                        <p className="text-dark mb-0 fs-16">Generate a charge sheet and make your work easier</p>
                    </div>
                </div>
            </div>
        </div>
    );
}
